import { Container, Row, Col, Card } from 'react-bootstrap';

function Headphones() {


    return ( 
        <>
        <Container>
            <Row>
                <Col>
                <Card style={{ width: '24rem', height:"20" }}>
                 <Card.Img 
                 variant="top" 
                 style={{objectFit:"cover"}}
                 src="https://images.unsplash.com/photo-1618366712010-f4ae9c647dcb?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=776&q=80" />
             </Card>
                </Col>
                <Col>
                </Col>
            </Row>
        </Container>
        </>
     );
}

export default Headphones;
